"""Test that convert it produces the desired dict."""
test_lookup_dict_1 = {'values': [{'people': [{'email': 'jim@jim.com',
    'phone': '111-111-1111'}]}]}
test_mapper_dict_1 = {'labels': {'email_address': 'email', 'phone_number':
    'phone'}}
convert = Converter(mapper=test_mapper_dict_1)
converted = convert.convert_it(test_lookup_dict_1)
check_converted = {'labels': {'email_address': 'jim@jim.com',
    'phone_number': '111-111-1111'}}
self.assertEqual(converted, check_converted)
